Magpie
```json
{
  "application": "Magpie",
  "software": [
    {
      "name": "Python",
      "version": "3.7.0",
      "modules": ["python/3.7.0", "scipy-stack/2018b"]
    },
    {
      "name": "Hadoop",
      "version": "2.7.7",
      "modules": [],
      "optional": {
        "setup_type": "MR",
        "hdfs_mode": [
          "hdfs",
          "hdfsoverlustre",
          "hdfsovernetworkfs",
          "rawnetworkfs"
        ],
        "job": [
          "terasort",
          "upgradehdfs",
          "decommissionhdfsnodes"
        ]
      }
    },
    {
      "name": "Spark",
      "version": "2.4.0-bin-hadoop2.7",
      "modules": [],
      "optional": {
        "setup_type": [
          "STANDALONE",
          "YARN"
        ],
        "job": [
          "sparkpi",
          "sparkwordcount"
        ]
      }
    }
  ],
  "resources": [
    {
      "name": "SLURM",
      "required": true,
      "optional": {
        "nodes": 8,
        "time": "3:00:00",
        "job_name": "spark-yarn-hdfs-setup",
        "partition": "",
        "ntasks_per_node": 1,
        "exclusive": true,
        "no_kill": true
      }
    },
    {
      "name": "NFS",
      "required": true,
      "optional": {
        "mount_point": "${HOME}/hadoop/magpie-master",
        "description": "Magpie scripts home"
      }
    },
    {
      "name": "Local storage",
      "required": true,
      "optional": {
        "mount_point": "$SLURM_TMPDIR",
        "description": "Magpie local data directory"
      }
    }
  ]
}
```
